import React, { Component } from "react";
import Events from "./events/Events";
import "./Home.css";
import { Route, Link, HashRouter } from "react-router-dom";

class Home extends Component {
  render() {
    return (
      <HashRouter>
        <div className="home">
          <div className="container">
            <div className="home-banner">
              <h1>CULTURE CLUB</h1>
            </div>
            <p>
              Catch up with friends... Cras facilisis urna ornare ex volutpat,
              et convallis erat elementum. Ut aliquam, ipsum vitae gravida
              suscipit, metus dui bibendum est, eget rhoncus nibh metus nec
              massa. Maecenas hendrerit laoreet augue nec molestie. Cum sociis
              natoque penatibus et magnis dis parturient montes, nascetur
              ridiculus mus.
            </p>
            <div className="events-banner">
              <img
                src="https://images.unsplash.com/photo-1468234847176-28606331216a?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1315&q=80"
                alt=""
              />
            </div>
            {/* <h2>
              <Link className="session-btns login-session-btn" to="/events">
                Events
              </Link>
            </h2>
            <Route path="/events" component={Events} /> */}
            <Events />
          </div>
        </div>
      </HashRouter>
    );
  }
}

export default Home;
